import styled from "styled-components";

export const StyledItem = styled.li`
    list-style: none;
    display: block;
    height: 30px;
    border: 2px solid slateblue;
    margin: 10px;
    text-align: center;
    border-radius: 5px;
    padding: 7px 7px px 7px;

`
